" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Cooperative cardiovascular project risk model for intracranial hemorrhage with thrombolytic therapy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\" rowspan=\"1\">",
"        Risk",
"Factors*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        Age &ge;75 years",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        Black race",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        Female sex",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        Prior history of stroke",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        Systolic blood pressure",
"      &ge;160 mmHg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        Weight &le;65 kg for women or &le;80 kg for men",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        INR &gt;4 or PT",
"&gt;24&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        Use of alteplase",
"(versus other thrombolytic agent)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Risk score",
"       </td>",
"       <td class=\"subtitle1_single\">",
"        Rate of intracranial",
"hemorrhage, percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        0 or 1",
"       </td>",
"       <td>",
"        0.69",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2",
"       </td>",
"       <td>",
"        1.02",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3",
"       </td>",
